import React from 'react'
import './skills.css'
import { Link } from 'react-scroll';


const Skills = () => {
    return (
        <section id="skills">
            <div className= "skillsContent"># Skills<span className="dash"></span>
            <div className='skill-name'>HTML</div>
            <div className="skill-bar">
                <div className="skill-per" per="40%" style="max-width:40%"></div>

            </div>
            </div>
        </section>
    )
}
export default Skills
